/**
 * Convert raw model provider and version data into user-friendly display names
 * @param provider - The model provider (e.g., 'openai', 'gemini', 'google-ai-overview')
 * @param version - The model version (e.g., 'gpt-4o-search-preview', 'gemini-2.5-flash-002')
 * @returns User-friendly model display name
 */
export function getModelDisplayName(provider: string, version?: string | null): string {
  const providerLower = provider?.toLowerCase() || ''
  const versionLower = version?.toLowerCase() || ''

  // WHY: Some Gemini model_version values omit the provider prefix (e.g., "1.5-pro"), so normalize
  // them before lookups to keep display names consistent in UI/tests.
  const lookupKeys = [
    `${providerLower}:${versionLower}`,
    providerLower === 'gemini' && versionLower && !versionLower.startsWith('gemini')
      ? `${providerLower}:gemini-${versionLower}`
      : null,
  ].filter(Boolean) as string[]

  for (const key of lookupKeys) {
    const displayFromMap = MODEL_DISPLAY_NAME_LOOKUP.get(key)
    if (displayFromMap) {
      return displayFromMap
    }
  }

  // 2. Fallback logic for Gemini partial matches
  // Gemini versions are often complex and might contain extra suffixes not in the map
  if (providerLower === 'gemini') {
    const geminiSeries = GEMINI_SUPPORTED_SERIES.find(series => {
      const escapedSeries = series.replace('.', '\\.')
      const seriesPattern = new RegExp(`(?:^|-)${escapedSeries}(?![\\d.])`)
      return seriesPattern.test(versionLower)
    })

    if (!geminiSeries) {
      return 'Gemini'
    }

    const baseName = `Gemini ${geminiSeries}`
    if (versionLower.includes('pro')) return `${baseName} Pro`
    if (versionLower.includes('flash')) return `${baseName} Flash`
    return baseName
  }

  // 3. Fallback to provider name
  if (PROVIDER_DISPLAY_NAMES[providerLower]) {
    // OpenAI allows custom versions to be displayed (uppercased) if not found in map
    if (providerLower === 'openai' || providerLower === 'openai-gpt') {
      return version ? version.toUpperCase() : PROVIDER_DISPLAY_NAMES[providerLower]
    }
    // Other providers (Google, Perplexity, etc.) strictly return provider name
    // ignoring unknown version strings (consistent with legacy behavior)
    return PROVIDER_DISPLAY_NAMES[providerLower]
  }

  return provider
}

